import React from 'react'
import '../../assets/css/home.css';
const MenuBar = () => {
  return (
    <div>
        <div className='menubar_top'></div>
        <div className='row'>
            <div className='col-lg-3'></div>
            <div className='col-lg-6'></div>
            <div className='col-lg-3'></div>
        </div>
    </div>
  )
}

export default MenuBar
